import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../footer.css'
export default function Footer() {
  return (
    <div class="footer">
    <Container fluid>
      <Row>
        <Col style={{ height: '200px', backgroundColor: 'black'}}>This has several listed items</Col>
        <Col style={{ height: '200px', backgroundColor: 'red' }}>2 of 3</Col>
        <Col style={{ height: '200px', backgroundColor: 'green' }}>3 of 3</Col>
      </Row>
    </Container>
  </div>

  )
}
